"    <div id=\"topicTitle\">",
"     Patient information: Hydrocele (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/hydrocele-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H15868391\">",
"      <span class=\"h1\">",
"       What is a hydrocele?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A hydrocele is a buildup of fluid inside the scrotum. The scrotum is the skin sac that holds the testicles, the 2 ball-shaped organs that hang between a man&rsquo;s legs (",
"      <a class=\"graphic graphic_figure graphicRef55941 \" href=\"UTD.htm?16/61/17360\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Hydroceles are common in newborn baby boys. They usually go away by the time the baby is 1 year old. Older boys and adult men can also get hydroceles.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15868408\">",
"      <span class=\"h1\">",
"       What are the symptoms of a hydrocele?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A hydrocele usually does not cause symptoms, except when it gets very large. When it does, the symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain or discomfort in the scrotum &nbsp;",
"       </li>",
"       <li>",
"        Feeling as though the scrotum is heavy or full",
"       </li>",
"       <li>",
"        Swelling or irritation in the skin around the scrotum",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15868423\">",
"      <span class=\"h1\">",
"       Is there a test for a hydrocele?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Tests include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Light test &ndash; Your doctor can shine a powerful light on the area of your scrotum where there is a swelling. If the light passes through, it means nothing solid is blocking the light. The fluid in a hydrocele does not block the light, so if the light goes through that, it is good proof that the swelling is a hydrocele.",
"       </li>",
"       <li>",
"        Ultrasound &ndash; This test uses sound waves to create pictures of the inside of the body. An ultrasound can tell the doctor if you have a hydrocele or a different condition.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15868440\">",
"      <span class=\"h1\">",
"       How is a hydrocele treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on what caused the hydrocele and what symptoms it causes. Treatment is not always necessary. Some hydroceles go away on their own. Depending on your age, symptoms, and type of hydrocele, you might not need treatment.",
"     </p>",
"     <p>",
"      If a baby has a hydrocele that does not go away by age 1, he will probably need surgery to remove the fluid or the sac that holds it.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H15868455\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
