"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/1\">",
"      Pollock AS, Arieff AI. Abnormalities of cell volume regulation and their functional consequences. Am J Physiol 1980; 239:F195.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/2\">",
"      Arieff AI, Llach F, Massry SG. Neurological manifestations and morbidity of hyponatremia: correlation with brain water and electrolytes. Medicine (Baltimore) 1976; 55:121.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/3\">",
"      Ayus JC, Wheeler JM, Arieff AI. Postoperative hyponatremic encephalopathy in menstruant women. Ann Intern Med 1992; 117:891.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/4\">",
"      Laureno R, Karp BI. Myelinolysis after correction of hyponatremia. Ann Intern Med 1997; 126:57.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/5\">",
"      Ellis SJ. Severe hyponatraemia: complications and treatment. QJM 1995; 88:905.",
"     </a>",
"    </li>",
"    <li>",
"     Guyton AC. Textbook of Medical Physiology, 7th ed., Saunders, Philadelphia, 1986, chap. 30.",
"    </li>",
