"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17875/abstract/7\">",
"      Knochel JP, Dotin LN, Hamburger RJ. Pathophysiology of intense physical conditioning in a hot climate. I. Mechanisms of potassium depletion. J Clin Invest 1972; 51:242.",
"     </a>",
"    </li>",
