"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17882/abstract/1\">",
"      Bastuji-Garin S, Rzany B, Stern RS, et al. Clinical classification of cases of toxic epidermal necrolysis, Stevens-Johnson syndrome, and erythema multiforme. Arch Dermatol 1993; 129:92.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?17/29/17882/abstract/2\">",
"      Stevens, AM, Johnson, FC. A new eruptive fever associated with stomatitis and ophthalmia: a report of two cases in children. Am J Dis Child 1922; 24:526.",
"     </a>",
"    </li>",
