var title_f17_29_17885="Treatment urge incontinence in women";
var content_f17_29_17885=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F76810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F76810&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Efficacy of behavioral and pharmacologic treatments for urge and mixed urinary incontinence in women",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Treatment",
"       </td>",
"       <td class=\"subtitle1\">",
"        Target population",
"       </td>",
"       <td class=\"subtitle1\">",
"        Efficacy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Behavioral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pelvic floor muscle exercises",
"       </td>",
"       <td>",
"        Women",
"       </td>",
"       <td>",
"        Up to 80 percent decrease in episodes; motivated patients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bladder retraining",
"       </td>",
"       <td>",
"        Cognitively intact",
"       </td>",
"       <td>",
"        &ge;35 percent decrease in UI episodes; pt perception of cure at 6 mos RR 1.69 [1.21-2.34]",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Prompted voiding",
"       </td>",
"       <td>",
"        Dependent, cognitively impaired",
"       </td>",
"       <td>",
"        Average reduction 0.8-1.8 in UI episodes daytime; cure rare, caregiver dependent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Habit training",
"       </td>",
"       <td>",
"        Voiding record available",
"       </td>",
"       <td>",
"        Highly dependent on caregiver compliance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Scheduled (timed) voiding",
"       </td>",
"       <td>",
"        Unable to toilet independently",
"       </td>",
"       <td>",
"        30 to 80 percent decrease in daytime episodes but study quality fair",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Pharmacologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        All antimuscarinics",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        WMD in daily UI episodes 0.6 (95 percent CI 0.4-0.8); dry mouth RR 2.56 (95 percent CI 2.24-2.92)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oxybutynin",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        ER: 71 percent mean reduction weekly UI episodes, cure rate 23 percent, dry mouth 30 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tolterodine",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        ER: 69 percent mean reduction weekly UI episodes, cure rate 17 percent, dry mouth 22 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trospium",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        20 mg bid: 59 percent mean reduction daily urge UI episodes (versus 44 percent with placebo), cure rate 21 percent, dry mouth 22 percent, constipation 10 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Darifenacin",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        7.5 mg or 15 mg daily: 68 percent and 73 percent, respectively, median reduction in weekly UI episodes (versus 56 percent with placebo). Dry mouth 19 percent and 31 percent respectively, constipation 14 percent (both doses)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Solifenacin",
"       </td>",
"       <td>",
"        Unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        5 mg or 10 mg daily: 61 percent and 52 percent, respectively, mean reduction daily UI episodes (versus 28 percent with placebo), dry mouth 8 percent and 23 percent, constipation 4 percent and 9 percent, respectively",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Estrogens",
"       </td>",
"       <td>",
"        Postmenopausal women unresponsive to behavioral treatment alone",
"       </td>",
"       <td>",
"        Topical of some benefit",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     WMD: weighed mean difference; ER: extended release, NA: not available; RR: relative risk.",
"    </div>",
"    <div class=\"reference\">",
"     Second International Consulation on Incontinence. Abrams P, Cardozo L, Khoury S, Wein A (Eds), Health Publication Ltd, Plymouth, UK 2002; Fonda D, DuBeau C, Harari D, et al. Incontinence in the Frail Elderly. In: Third International Consulation on Incontinence. Abrams P, Cardozo L, Khoury S, Wein A (Eds), Health Publication Ltd,&nbsp;Plymouth, UK 2005; Cochrane Library (Accessed December 2004); Diokno A, Appell RA, Sand PK, et al. Prospective, randomized, double-blind study of the efficacy and tolerability of the extended-release formulations of oxybutynin and tolterodine for overactive bladder: Results of the OPERA trial. Mayo Clin Proc 2003; 78:687; Zinner N, Gittelman, Harris R, et al. Trospium chloride improves overactive bladder symptoms: a multicenter phase III trial. J Urol 2004; 171:2311; Cardoza L, Lisec M, Millard R, et al. Randomized, double-blind placebo controlled trial of the once daily antimuscarinic agent solifenacin succinate in patients with overactive bladder. J Urol 2004; 172:1919; Haab F, Stewart L, Dwyer P. Darifenacin, an M3 selective receptor antagonist, is an effective and well-tolerated once-daily treatment for overactive bladder. Eur Urol 2004; 45:420; Cardozo L, Lose G, McClish D, Versi E. A systematic review of the effects of estrogens for symptoms suggestive of overactive bladder. Acta Obstet Gynecol Scan 2004; 83:892.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
